import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Slider from '@mui/material/Slider';
import { PieChart, Pie, Cell, Tooltip, Legend } from 'recharts';
import Recommendation from '../components/Recommendation';

const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

const Dashboard = () => {
  const [profile, setProfile] = useState(null);
  const [error, setError] = useState('');
  const [investment, setInvestment] = useState(50000); // default investment amount

  const investmentData = [
    { name: 'Stocks', value: investment * 0.4 },
    { name: 'Mutual Funds', value: investment * 0.3 },
    { name: 'Real Estate', value: investment * 0.2 },
    { name: 'Gold', value: investment * 0.1 },
  ];

  useEffect(() => {
    const fetchProfile = async () => {
      const token = localStorage.getItem('token');
      try {
        const res = await axios.get('http://localhost:5000/api/profile', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setProfile(res.data);
      } catch (err) {
        setError(err.response?.data?.message || 'Failed to load profile');
      }
    };

    fetchProfile();
  }, []);

  if (error) return <div>Error: {error}</div>;
  if (!profile) return <div>Loading profile...</div>;

  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">Welcome, {profile.name}!</h2>
      <div className="mb-4 space-y-2">
        <p><strong>Monthly Income:</strong> ₹{profile.monthlyIncome}</p>
        <p><strong>Monthly Expenses:</strong> ₹{profile.monthlyExpenses}</p>
        <p><strong>Risk Appetite:</strong> {profile.riskAppetite}</p>
        <p><strong>Financial Goal:</strong> {profile.financialGoal}</p>
        <p><strong>Investment Horizon:</strong> {profile.investmentHorizon} years</p>
      </div>

      {/* Investment Adjustment */}
      <div className="mt-6">
        <h3 className="font-semibold mb-2">Adjust Your Investment Amount</h3>
        <Slider
          value={investment}
          onChange={(e, newVal) => setInvestment(newVal)}
          aria-labelledby="investment-slider"
          valueLabelDisplay="auto"
          min={10000}
          max={200000}
        />
        <p className="mt-2 text-sm">Custom Investment: ₹{investment}</p>
      </div>

      {/* Pie Chart */}
      <div className="mt-6">
        <h3 className="font-semibold mb-2">Your Suggested Distribution</h3>
        <PieChart width={400} height={300}>
          <Pie
            data={investmentData}
            cx={200}
            cy={150}
            labelLine={false}
            label={({ name, percent }) => `${name}: ${(percent * 100).toFixed(0)}%`}
            outerRadius={100}
            fill="#8884d8"
            dataKey="value"
          >
            {investmentData.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </div>

      {/* Recommendations */}
      <Recommendation profile={profile} investment={investment} />
    </div>
  );
};

export default Dashboard;
